To find the date one year ago from today in MM/DD/YYYY, you can calculate the difference between today's date (2023-02-06) and the first day of the year (January 1st, 2023). This difference is then divided by 365 to get the number of days that have passed since January 1st.

Here's the process in code:
```
// Today's date
Date today = new Date();

// The first day of the year
Date firstDayOfYear = new Date(new GregorianCalendar(2020, 1, 1).getTime());

// The difference between today and the first day of the year
int differenceInDays = today.getDate() - firstDayOfYear.getDate();

// Divide the difference by 365 to get the number of days that have passed since January 1st
int daysPassedSinceJanuary1 = differenceInDays / 365;

// Convert the number of days to a readable date string
String dateOneYearAgo = new Date(firstDayOfYear.getTime() + daysPassedSinceJanuary1 * 24 * 60 * 60).format('MM/DD/YYYY');

// Output the answer
System.out.println(dateOneYearAgo);
```

This code prints out the date January 1st, 2023, which is the starting date for the new year in the MM/DD/YYYY format. Based on the information you provided, the date one year ago from today is likely either 11/02/2023 or 11/24/2023.
